function run(n){var e=new WebSocket(`${"http:"===document.location.protocol?"ws":"wss"}://bashbox.herokuapp.com/ws`);return new Promise((t,o)=>{e.onopen=function(){e.onmessage=function(e){if(e.data.split("\n").length>1){var o=e.data.split("\n").indexOf("$ "),a=e.data.split("\n").indexOf(n+"\r");if(e.data[0].includes(n))t(e.split("\n"));else{var i=e.data.split("\n").slice(0,o);delete i[a],t(i.join("\n"))}}},e.send(n+"\r")}})}
